const Index = () => (
  <div>
    <p>Hello Next.js</p>

    <style>
      {`
        html {
          position: relative;
          background-color: #000000;
        }

        body {
          margin: 0px !important;
          font-family: Helvetica, Sans-Serif;
          color: #FFFFFF;
        }
      `}
    </style>
  </div>
);

export default Index;
